dge that it is my responsibility to disclose any new SIGNIFICANT FINANCIAL INTERESTS obtained during the term of the above proposed project. I certify that this is a complete disclosure of all my financial interests related to the above proposed project.','Acknowledgement statement presented as part of the Disclosure document.','A','KC'),('KC-COIDISCLOSURE','Document','COI_CERTIFICATION_STATEMENT','C041EF5965AB6B48E040DC0A1F8A15A8',1,'CONFG','<p>In accordance with the University\'s policy on Disclosure of Financial Interests and Management of Conflict of Interest Related to Sponsored Projects, the Principal Investigator and all other Investigators who share responsibility for the design, conduct, or reporting of sponsored projects must disclose their personal SIGNIFICANT FINANCIAL INTERESTS in any non-profit foundation or for-profit company that might benefit from the predictable results of those proposed projects.</p><p>In addition, when the work to be performed under the proposed research project and the results of the proposed research project would reasonably appear to affect the Investigator\'s SIGNIFICANT FINANCIAL INTEREST, the interest is regarded as being related to the proposed research project and must be reported.</p><p>For the purposes of this disclosure, SIGNIFICANT FINANCIAL INTEREST is considered to include:</p><ol>  <li>Income (Includes salary, stock dividends and/or interest earned, consulting fees, royalty payments and honoraria from a single business entity exceeding $10,000).</li><li>Position with a single business entity (Includes director, employee, founder, manager, officer, partner, trustee, or advisory board member).</li>  <li>Investment Ownership or Controlling Interest of more than 5% of the voting stock in a single business entity.</li><li>Interest in Intellectual Property Rights belonging to a single business entity (Includes patents, copyrights or other license rights).</li></ul>','Certification instructions presented as part of the Disclosure document.','A','KC'),('KC-COIDISCLOSURE','Document','COI_DISCLOSURE_FE_CONFLICT_HEADER_LABEL','C041EF5965A96B48E040DC0A1F8A15A8',1,'CONFG','Related','Column header label for Coi FE conflict','A','KC'),('KC-COIDISCLOSURE','Document','SCREENING_QUESTIONNAIRE_KRMS_RULE','F964F930E6F3C2B4E040DC0A1F8A5308',1,'CONFG','KC10000','The KRMS business rule id that defines whether the screening questionnaire answers are currently valid and whether the user needs a new financial entity.','A','KC'),('KC-COIDISCLOSURE','Document','WORK_IN_PROGRESS_REVIEW_STATUSES','F964F930E6E4C2B4E040DC0A1F8A5308',1,'CONFG','6;7;8','A list of semi-colon delimited COI review status codes that are considered \'In Progress\'','A','KC'),('KC-COIDISCLOSURE','Document','coiAdministratorActionHelp','C041EF5967A76B48E040DC0A1F8A15A8',1,'HELP','default.htm?turl=Documents/administratoraction.htm','Administrator Actions Help','A','KC'),('KC-COIDISCLOSURE','Document','coiAttachmentDefaultSort','C041EF5967996B48E040DC0A1F8A15A8',1,'CONFG','LAUP','Default sort for coi disclosure attachments','A','KC'),('KC-COIDISCLOSURE','Document','coiCertificationHelp','C041EF5965456B48E040DC0A1F8A15A8',1,'HELP','default.htm?turl=Documents/certificationannualdisclosure.htm','Coi CertificationPage Help','A','KC'),('KC-COIDISCLOSURE','Document','coiDisclosure1Help','C041EF5967D76B48E040DC0A1F8A15A8',1,'HELP','default.htm?turl=Documents/disclosure1.htm','Disclosure Help','A','KC'),('KC-COIDISCLOSURE','Document','coiDisclosureHelp','C041EF5965406B48E040DC0A1F8A15A8',1,'HELP','default.htm?turl=Documents/disclosure.htm','Coi Disclosure Page Help','A','KC'),('KC-COIDISCLOSURE','Document','coiDisclosureReviewerHelp','C041EF5967A56B48E040DC0A1F8A15A8',1,'HELP','default.htm?turl=Documents/revieweractions.htm','Disclosure Reviewer Actions Help','A','KC'),('KC-COIDISCLOSURE','Document','coiDisclosuremanualHelp','C041EF5967A66B48E040DC0A1F8A15A8',1,'HELP','default.htm?turl=Documents/manualevent.htm','Manual Event and Financial En